import React, { useContext } from 'react'
import { StoreContext } from "../../context/StoreContext";

const  Table = () =>{



  const { store } = useContext(StoreContext);  

  return (
    <div>
      <table className="striped highlight centered">
        <thead>
          <td>Index</td>
          <td>Name</td>
          <td>Miss Distance</td>
          <td>Average Size</td>
          <td>Close Approach Date</td>
          <td>Relative Velocity in KM/h</td>
          <td>URL</td>
        </thead>
          <tbody>
            {store.data.map((meteoroid,idx) => {
              return (
                <tr key={meteoroid.id}>
                  <td> {idx+1}</td>
                  <td> {meteoroid.name}</td>
                  <td>{meteoroid.missDistance}</td>
                  <td>{meteoroid.avgSize}</td>
                  <td>{meteoroid.closeApproachDate}</td>
                  <td>{meteoroid.speed}</td>
                  <td><a href={meteoroid.url}>Link</a></td>
                </tr>
              );
            })}
          </tbody>
      </table>
    </div>
  )
}

export default Table;
